import React, { Component } from 'react'

export default class ListTasks extends Component {
    constructor(props) {
        super(props)
        this.state = {
            Tasks: [{}]
        }
    };
    componentDidMount() {
        (async () => {
            const rawResponse = await fetch('/tasks/', {
                method: 'GET',
                headers: {
                    'Accept': 'application/json',
                    'Content-Type': 'application/json'
                }
            });
            const response = await rawResponse.json();
            if (response != null && response.length > 0) {
                this.setState({ Tasks: response });
            }
        })();
    }
    render() {
        console.log(this.props);
        return (
            <table className="table-content table-bordered table-dark">
                <thead>
                    <tr>
                        <th>No.</th>
                        <th>Name</th>
                        <th>Type</th>
                        <th>Status</th>
                        <th>StartDate</th>
                        <th>EndDate</th>
                    </tr>
                </thead>
                <tbody>
                    {console.log(this.state.Tasks.length)}
                    {this.state.Tasks.length > 1 ? this.state.Tasks.map((Task, index) => {
                        return (
                            <tr key={index}>
                                <td>{index}</td>
                                <td>{Task.Name}</td>
                                <td>{Task.Type === 1 ? "Urgent" : "Midium"}</td>
                                <td>{Task.Status === 1 ? "Pending" : "Assigned"}</td>
                                <td>{Task.StartDate !== null ? Task.StartDate.toLocaleString().split(',')[0] : ""}</td>
                                <td>{Task.EndDate !== null ? Task.EndDate.toLocaleString().split(',')[0] : ""}</td>
                            </tr>
                        )
                    }) : ""}
                </tbody>
            </table>
        )
    }
}
